// main.js
import Vue from 'vue';
import App from './App.vue';
import Toasted from 'vue-toasted';
import 'vue-toasted/dist/vue-toasted.min.css';

Vue.use(Toasted);

new Vue({
  render: (h) => h(App),
}).$mount('#app');
